import './GreatOperationButton.css';

const ButtonOperation = (props) => {
    return(
    <div>
     <table>
        <tr>
        <td>+</td>
        <td>-</td>
        <td>*</td>
        <td>/</td>
        </tr>

    </table>
    </div>
    )
  }

export default ButtonOperation;
